import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles(theme => ({
  root: {
    width: '90%',
  },
  backButton: {
    marginRight: theme.spacing(1),
  },
  instructions: {
    marginTop: theme.spacing(1),
    marginBottom: theme.spacing(1),
  },
}));

function getSteps() {
  return ['Select master blaster campaign settings', 'Create an ad group', 'Create an ad', 'test'];
}

function getStepContent(stepIndex) {
  switch (stepIndex) {
    case 0:
      return step1();
    case 1:
      return step2();
    case 2:
      return step3();
    case 3:
      return step4();
    default:
      return 'Uknown stepIndex';
  }
}

export default function HorizontalLabelPositionBelowStepper() {
  const classes = useStyles();
  const [activeStep, setActiveStep] = React.useState(0);
  const steps = getSteps();

  function handleNext() {
    setActiveStep(prevActiveStep => prevActiveStep + 1);
  }

  function handleBack() {
    setActiveStep(prevActiveStep => prevActiveStep - 1);
  }

  function handleReset() {
    setActiveStep(0);
  }
  return (
    <div className={classes.root}>
      <Stepper activeStep={activeStep} alternativeLabel>
        {steps.map(label => (
          <Step key={label}>
            <StepLabel>{label}</StepLabel>
          </Step>
        ))}
      </Stepper>
      <div>
        {activeStep === steps.length ? (
          <div>
            <Typography className={classes.instructions}>All steps completed</Typography>
            <Button onClick={handleReset}>Reset</Button>
          </div>
        ) : (
          <div>
            <Typography className={classes.instructions}>{getStepContent(activeStep)}</Typography>
            <div>
              <Button
                disabled={activeStep === 0}
                onClick={handleBack}
                className={classes.backButton}
              >
                Back
              </Button>
              <Button variant="contained" color="primary" onClick={handleNext}>
                {activeStep === steps.length - 1 ? 'Finish' : 'Next'}
              </Button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}


export function step1() {
  return (
    <>
      <div className="my-auto mh-100 mx-5 p-5 text-center">
        <div className="h1">
            Create account
        </div>
        <p className="helpText">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
        <div className="d-flex flex-column">
            <div className="mx-auto my-3">
                <button type="button" className="btn btn-dark text-white customButton  px-4 d-flex "> 
                    <span>
                        
                    </span>
                    <span>Sign up with email</span>
                </button>
            </div>                                    
            <div className="mx-auto my-3">
                <button type="button" className="btn btn-default customButton px-4 border d-flex"> 
                    <span>
                        
                    </span>
                    <span>Sign up with Google</span>
                </button>
            </div>                                    
            <div className="mx-auto my-3">
                <button type="button" className="btn btn-default customButton px-4 border d-flex"> 
                    <span>
                    
                    </span>
                    <span>Sign up with Facebook</span>
                </button>
            </div>
        </div>
      </div>
    </>
  );
}

export function step2() {
  return (
    <>
    test 2
    </>
  );
}

export function step3() {
  return (
    <>
    test 3
    </>
  );
}

